window.onload=()=>{(async()=>{const e=await fetch("/getRoom",{method:"GET",headers:{"Content-Type":"application/json"}}),n=await e.json(),o=n.roomData;if(console.log("Room Data: "+JSON.stringify(o)),!n)return;const r=document.querySelector("#roomName"),a=document.querySelector("#roomTheme"),t=document.querySelector("#roomMembers");switch(r.innerHTML=`Name: ${o.name}`,a.innerHTML="Theme: ",o.theme){case"default":a.innerHTML+="Default";break;case"coffee":a.innerHTML+="Coffee";break;case"western":a.innerHTML+="Western";break;case"cyberpunk":a.innerHTML+="Cyberpunk";break;case"kawaii":a.innerHTML+="Kawaii";break;default:a.innerHTML+="Undefined"}t.innerHTML=`Amount of Members: ${o.amtMembers}`})()};